CREATE TABLE IF NOT EXISTS `user_temp` AS SELECT * FROM `user` WHERE 1=2;
CREATE TABLE IF NOT EXISTS `user_role_temp` AS SELECT * FROM `user_role` WHERE 1=2;









DELETE FROM `user_temp` WHERE EXISTS (SELECT '1' FROM `user` WHERE `user`.`id` = `user_temp`.`id`);

DELETE FROM `user_role_temp` WHERE EXISTS (SELECT '1' FROM `user` WHERE `user`.`id` = `user_role_temp`.`user_id`);